/**
 * Analyst the syntax that does not depend on indentation
 * @param {string} line
 * @returns
 */
export function syntax(line: string): any[];
/**
 *
 * @param {string} content
 * @param {Tag} tag
 * @param {Args} args
 * @param {Elements} elements
 * @returns
 */
export function parse(content: string, tag: Tag, args: Args, elements: Elements): any[];
export function createArg(index: number): string;
export type Tag = (type: string, props?: any, children?: any) => any;
export type Args = any[];
export type Elements = {
    title: string;
    text: string;
    link: string;
    inlineCode: string;
    code: string;
    nestedCode: string;
    quote: string;
    table: string;
    tableRow: string;
    tableCol: string;
    bold: string;
    italic: string;
    image: string;
    list: [string, string];
    listItem: string;
    tab: string;
};
